import createReactComponent from '../createReactComponent';
var Clock5 = createReactComponent('Clock5', [['circle', {
  cx: '12',
  cy: '12',
  r: '10',
  key: '1mglay'
}], ['polyline', {
  points: '12 6 12 12 14.5 16',
  key: '1pcbox'
}]]);
export default Clock5;
